import React, { useState } from "react";

function Mycalc() {
  const [num1, setNum1] = useState();
  const [num2, setNum2] = useState();
  const [opt, setOpt] = useState();
  const [num, setNum] = useState("");
  var s;
  const handleEqButton = () => {
    var a = parseInt(num1);
    var b = parseInt(num);

    switch (opt) {
      case "+":
        var c = a + b;
        setNum(c);
        break;
      case "-":
        var c = a - b;
        setNum(c);
        break;
      case "*":
        var c = a * b;
        setNum(c);
        break;
      case "/":
        var c = a / b;
        setNum(c);
        break;
      default:
        alert("please select operation");
    }
  };
  const handleOptButton = (evt) => {
    setOpt(evt.target.value);
    setNum1(num);
    setNum("");
  };

  const handleNumberButton = (evt) => {
    s = num;
    s = s + evt.target.value;
    setNum(s);
  };

  const handleClearButton = (evt) => {
    setNum("");
    setNum1("");
    setNum2("");
    setOpt("");
  };
  return (
    <div>
      <center>
        <input type="text" value={num} />
        <table style={{ backgroundColor: "aqua" }}>
          <tr>
            <td>
              <button
                style={{ backgroundColor: "green" }}
                type="submit"
                value={7}
                onClick={handleNumberButton}>
                7
              </button>
            </td>
            <td>
              <button type="submit" value={8} onClick={handleNumberButton}>
                8
              </button>
            </td>
            <td>
              <button type="submit" value={9} onClick={handleNumberButton}>
                9
              </button>
            </td>
          </tr>
          <tr>
            <td>
              <button type="submit" value={4} onClick={handleNumberButton}>
                4
              </button>
            </td>
            <td>
              <button type="submit" value={5} onClick={handleNumberButton}>
                5
              </button>
            </td>
            <td>
              <button type="submit" value={6} onClick={handleNumberButton}>
                6
              </button>
            </td>
          </tr>
          <tr>
            <td>
              <button type="submit" value={1} onClick={handleNumberButton}>
                1
              </button>
            </td>
            <td>
              <button type="submit" value={2} onClick={handleNumberButton}>
                2
              </button>
            </td>
            <td>
              <button type="submit" value={3} onClick={handleNumberButton}>
                3
              </button>
            </td>
          </tr>
          <tr>
            <td>
              <button type="submit" value={0} onClick={handleNumberButton}>
                0
              </button>
            </td>
            <td>
              <button type="submit" value="+" onClick={handleOptButton}>
                +
              </button>
            </td>
            <td>
              <button type="submit" value="-" onClick={handleOptButton}>
                -
              </button>
            </td>
          </tr>
          <tr>
            <td>
              <button type="submit" value="*" onClick={handleOptButton}>
                *
              </button>
            </td>
            <td>
              <button type="submit" value=" /" onClick={handleOptButton}>
                {" "}
                /
              </button>
            </td>
            <td>
              <button type="submit" value="=" onClick={handleEqButton}>
                =
              </button>
            </td>
          </tr>
          <tr>
            <td colSpan={3}>
              <button type="submit" value="clear" onClick={handleClearButton}>
                CLEAR
              </button>
            </td>
          </tr>
        </table>
      </center>
    </div>
  );
}
export default Mycalc;
